def data
  @data ||= DATA.read.split("\n").map { |row| row.chars }
end

def search(x:, y:)
  count = 0
  return count unless data[y][x] == "X"

  (-1..1).each do |x_off|
    (-1..1).each do |y_off|
      next if
        x_off.zero? && y_off.zero? ||
          (x + (x_off * 3)).negative? ||
          (y + (y_off * 3)).negative? ||
          (x + (x_off * 3)) > data.size ||
          (y + (y_off * 3)) > data.first.size
      if locate(x: x + (x_off * 1), y: y + (y_off * 1), char: "M") &&
          locate(x: x + (x_off * 2), y: y + (y_off * 2), char: "A") &&
          locate(x: x + (x_off * 3), y: y + (y_off * 3), char: "S")
        # puts [[x, y], [x + x_off, y + y_off], [x + x_off * 2, y + y_off * 2], [x + x_off * 3, y + y_off * 2]].inspect
        # puts [data.dig(y, x), data.dig(y + y_off, x + x_off), data.dig(y + y_off * 2, x + x_off * 2), data.dig(y + y_off * 3, x + x_off * 3)].inspect
        count += 1
      end
    end
  end
  count
end

def locate(x:, y:, char:)
  data.dig(y, x) == char
end

counter = 0
data.each_with_index do |row, y|
  row.each_with_index do |_cell, x|
    counter += search(x: x, y: y)
  end
end

puts counter

